<!DOCTYPE html>
<html>
<head>
    <meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1, user-scalable=0">
    <style>
        @font-face {
            font-family: 'SF Pro Display';
            src: url('fonts/SF-Pro-Display-Regular.otf') format('opentype');
            /* Add other font variations as needed (e.g., bold, italic, etc.) */
        }

        html, body {
            height: 100%;
            margin: 0;
            overflow-x:hidden;
        }

        body {
            background-color: #2b2b2b;
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 100%;
            max-width: 100%;
            overflow: hidden;
            overflow-x: hidden;
            position: relative; /* Add this to make positioning easier */
        }

        .phone-screen {
            width: 100%; /* Responsive width */
            max-width: 414px; /* Max phone screen width */
            height: 100vh;
            background-color: #ffffff;
            overflow-y: auto; /* Enable vertical scrolling if content exceeds the screen */
            z-index: 0;
            position: relative; /* Add this for proper positioning */
            display: flex;
            flex-direction: column; /* Place content in the center of the screen */
            /* Center content horizontally */
            overflow-x: hidden;
        }

        .container {
            margin-left: 30px;
            margin-top: 20px;
  display: flex;
  align-items: center;
  width: 100%;
}

.textbox {
  flex: 1;
  border: none;
  font-size: 35px;
  max-width: 150px;
  padding: 10px;
  font-family: 'SF Pro Display', Arial, sans-serif;
}

.custom-button {
  padding: 3px;
  border: none;
  background-color: #ffffff;
  cursor: pointer;
  display: flex;
  align-items: center;
  justify-content: center;
}


.full-width-btn {
  background-color: black;
  color: white;
  font-size: 25px;
  border-radius: 10px;
  border: none;
  padding: 5px 10px;
  display: block;
  width: 86%;
  box-sizing: border-box;
  font-family: 'SF Pro Display', Arial, sans-serif;
  margin-left: 30px;
  margin-top: 20px;
}

</style>
</head>
